    false,nt"url": null,nt"notes": "NODC accession 0104289 includes physical
    and underway data collected aboard the KNORR during cruise KN197-08 in the Caribbean
    Sea and North Atlantic Ocean from 2010-05-22 to 2010-06-24. These data include CURRENT
    SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The
    instruments used to collect these data include ADCP and GPS. These data were collected
    by Patricia Yager of UNIVERSITY OF GEORGIA; School of Marine Programs, and by Woods
    Hole Oceanographic Institution as part of Amazon iNfluence on the Atlantic: CarbOn
    export from Nitrogen fixation by DiAtom Symbioses (ANACONDAS). The Lamont-Doherty
    Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
    Rolling Deck to Repository (R2R) program. The ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
    accession.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
